sources.css\\index.scss:
* {
    margin: 0;
    padding: 0;
}

li {
    list-style: none;
}

a {
    display: block;
    text-decoration: none;
    color: black;
}


$box: 3px 2px 5px 2px #ccc;
$color: #C4D9F8;
$font-family: 'NanumSquare';
$font-family1: 'BodoniFLF';
$font-family2: 'BodoniFLF-Bold';
$bg: #e6e2df;

p,
a,
span,
div,
li {
    font-family: $font-family;
    font-size: 14px;
}

@font-face {
    font-family: 'BodoniFLF-Bold';
    src: url(../font/BodoniFLF-Bold.ttf);
    font-weight: bold;
}

@font-face {
    font-family: 'BodoniFLF';
    src: url(../font/BodoniFLF-Roman.ttf);
}

@import url("https://cdn.jsdelivr.net/gh/orioncactus/pretendard/dist/web/static/pretendard.css");


/***************************************************/


.header {
    position: fixed;
    display: flex;
    justify-content: space-between;
    top: 0;
    z-index: 10;
    width: 100%;
    height: 100px;
    box-shadow: 5px 5px 5px 5px #999;
    overflow: hidden;

    &:hover .header_bg {
        opacity: 1;
    }

    .header_bg {
        position: absolute;
        width: 100%;
        height: 100px;
        background-color: #fff;
        opacity: 0.4;
        z-index: -1;

    }

    .logo {
        margin-left: 10%;
        height: 100px;

        &:hover {
            >a {
                >img {
                    width: 100%;

                    &:nth-child(1) {
                        display: none;
                    }

                    &:nth-child(2) {
                        display: block;
                        transition: 0.3s;
                        width: 95%;
                        transform: translate(10px, 10px);

                    }
                }
            }

        }

        >a {
            width: 100px;
            height: 100px;

            >img {
                width: 100%;
                transition: 0.3s;

                &:nth-child(2) {
                    display: none;
                }
            }
        }


    }

    .lnb {
        width: 50%;
        height: 100px;
        text-align: center;
        line-height: 130px;
        margin-right: 1%;

        >ul {
            display: flex;
            justify-content: space-evenly;


            >li {
                margin-right: 20px;

                >a {
                    font-size: 25px;
                    font-family: $font-family2;
                    color: #222;

                    &:hover {
                        color: #999;
                    }
                }
            }
        }
    }
}

.indicate {
    position: absolute;
    z-index: 100;
    /*  top: 50%; */
    right: 20px;
    width: 90px;

    >li {

        text-align: center;
        margin-bottom: 30px;
        cursor: pointer;

        &:last-child {
            margin-bottom: 0;
        }

        >a {
            >p {
                width: 90px;
                margin-right: 30px;
                display: none;
                font-weight: bold;
                font-family: $font-family1;
            }

            .indi_btn {
                margin: 0 auto;
                width: 20px;
                height: 20px;
                width: 20px;
                height: 20px;
                border-radius: 50%;
                background-color: #eee;
            }
        }

        &.on {
            >a {
                >p {
                    display: block;
                }

                .indi_btn {
                    display: none;
                }
            }
        }
    }

}


.wrap {
    >div {
        width: 100%;
        height: 100vh;

        .page_container {
            padding: 20px 20px 20px 20px;
            box-sizing: border-box;
            width: 1300px; height: 100vh;
            margin: 0 auto;
            >p {
                font-family: $font-family1;
                font-size: 40px;
                margin-left: 100px;
                color: #ccc;
            }
        }
    }

    .main_page {
        position: relative;
        overflow: hidden;

        >img {
            position: absolute;
            z-index: -1;
            width: 100%;
        }

        .main_box {
            width: 1300px;
            margin: 0 auto;
            padding-top: 100px;
            box-sizing: border-box;

            .main_img {
                width: 100%;
                /* font-family: 'Source Code Pro', monospace; */
                /* font-family: 'Nanum Gothic', sans-serif; */
                font-family: 'Freesentation-9Black';
                /* font-family: 'WAGURITTF'; */
                /* font-family: 'JalnanGothic'; */
                margin: 0 auto;
                height: 100%;

                h1 {
                    text-transform: uppercase;
                    transform: translate(-50%, -50%) skew(10deg) rotate(-10deg);
                    font-size: 11vw;
                    top: 50%;
                    left: 49%;
                    margin: 0;
                    position: absolute;
                    text-rendering: optimizeLegibility;
                    font-weight: 900;
                    color: rgba(#ff9eb1, 0.5);
                    text-shadow: 1px 4px 6px $bg, 0 0 0 #66303a, 1px 4px 6px $bg;
                    white-space: nowrap;

                    &:before {
                        content: attr(data-heading);
                        position: absolute;
                        left: -9px;
                        top: -4.8%;
                        overflow: hidden;
                        width: 100%;
                        height: 50%;
                        color: #fbf7f4;
                        transform: translate(1.6vw, 0) skew(-13deg) scale(1, 1.2);
                        z-index: 2;
                        text-shadow: 2px -1px 6px rgba(0, 0, 0, 0.2);
                    }

                    &:after {
                        content: attr(data-heading);
                        position: absolute;
                        left: 0;
                        top: 0;
                        overflow: hidden;
                        width: 100%;
                        height: 100%;
                        z-index: 1;
                        color: #d3cfcc;
                        transform: translate(0vw, 0) skew(13deg) scale(1, 0.8);
                        clip-path: polygon(0 50%, 100% 50%, 100% 100%, 0% 100%);
                        text-shadow: 2px -1px 6px rgba(0, 0, 0, 0.3);
                    }
                }
            }



            .typing {
                position: absolute;
                top: 90px; left: 100px;
                width: 100%;
                height: 55px;
                /* display: flex;
                justify-content: center;
                align-items: flex-end; */

                >p {
                    font-size: 20px;
                    line-height: 40px;
                    color: #fff;
                    font-family: $font-family;
                }

                >img {
                    filter: invert(100%);
                    width: 20px;
                    height: 20px;
                    margin-bottom: 30px;
                }

                .text {
                    font-family: $font-family;
                    font-size: 20px;
                    /* color: #ff9eb1; */
                    font-weight: bold;

                    &::after {
                        content: '';
                        border-right: 2px solid #777;
                        animation: cursor .9s infinite steps(2);
                    }
                }
            }

            .resume {
                position: absolute;
                top: 130px; left: 100px;
                width: 400px;
                overflow: hidden;


                >ul {
                    display: flex;

                    >img {
                        width: 20px;
                        height: 20px;
                    }

                    >li {
                        margin-left: 10px;
                        cursor: pointer;

                        >a {
                            display: inline;
                            position: relative;
                            color: #fff;
                            font-size: 20px;
                            background: linear-gradient(90deg, #1e57a0, rgba(30, 86, 160, 0));
                            background: linear-gradient(90deg, #1e57a0, rgba(30, 86, 160, 0.5));
                            background: linear-gradient(90deg, #ff9eb1, rgba(255, 158, 177, 0.5));
                            background: linear-gradient(90deg, #ff9eb1, rgba(30, 86, 160, 0.5));
                            background: linear-gradient(90deg, #ff9eb1, rgba(107, 143, 191, 0.5));
                            height: 4px;
                            font-weight: bold;

                            &:hover {
                                color: rgba(255, 255, 255, 0.76);
                            }
                        }
                    }
                }
            }

            .main_icon {
                position: absolute;
                top: 610px; left: 50%;
                scale: 2.5;
                transform: translate(-50%, -50%);
                
                .fa-angle-double-down{
                    color: rgba(255, 158, 177, 0.5);
                    width: 20px; height: 20px;
                    text-align: center;
                    text-shadow: 1px 4px 6px $bg, 0 0 0 #bb8b94, 1px 4px 6px $bg; 
                    animation: moveUpDown 2s infinite;
                }
                @keyframes moveUpDown {
                    0% {
                        transform: translateY(-50%);
                    }
                    50% {
                        transform: translateY(50%);
                    }
                    100% {
                        transform: translateY(-50%);
                    }
                }
                  
                
            }

        }

    }

    #page1 {
        .page_box {
            .page_inner {
                width: 1200px;
                height: 580px;
                margin: 0 auto;
                background-color: #f3f3f3;
                border-radius: 100px;

                .page1_tit {
                    display: flex;

                    >img {
                        margin-top: 30px;
                        width: 130px;
                        margin-left: 100px;
                    }

                    >p {
                        margin-left: 25px;
                        margin-top: 70px;
                        color: #879ec2;
                        font-weight: bold;
                        font-size: 20px;
                    }
                }

                .page1_txt {
                    width: 100%;
                    height: 140px;
                    background-color: #fff;
                    padding: 0 100px;
                    box-sizing: border-box;
                    justify-content: space-evenly;


                    >div {
                        display: flex;
                        padding-left: 100px;

                        >ul {
                            width: 500px;
                            display: flex;
                            padding: 5px 0;
                            margin-top: 20px;
                            margin-right: 80px;
                            box-sizing: border-box;

                            &:last-child {
                                width: 625px;
                                margin-right: 0;
                            }

                            li {
                                >img {
                                    display: block;
                                    width: 14px;
                                    margin-right: 20px;
                                    margin-bottom: 14px;
                                }

                                >p {
                                    font-size: 14px;
                                    margin-bottom: 20px;

                                }


                            }

                            .info {
                                margin-left: 50px;
                                font-weight: bold;
                            }

                        }

                    }




                }

                >ul {
                    margin: 0 auto;
                    margin-top: 20px;
                    text-align: center;
                    display: flex;
                    justify-content: space-evenly;
                    padding: 0 50px;
                    box-sizing: border-box;

                    >li {
                        width: 300px;
                        height: 260px;
                        border: 5px solid $color;
                        border-radius: 40px;
                        box-shadow: $box;

                        &:nth-child(3) {
                            margin-right: 0;
                        }

                        &:nth-child(1)>h5 {
                            margin-bottom: 70px;
                        }

                        &:nth-child(2)>h5 {
                            margin-bottom: 60px;
                        }

                        &:nth-child(3)>h5 {
                            margin-bottom: 30px;
                        }

                        >h5 {
                            width: 80%;
                            margin: 20px auto;
                            font-size: 24px;
                            color: $color;
                            color: #879ec2;
                            border-bottom: 3px solid $color;
                        }

                        >p {
                            margin-bottom: 20px;
                            font-size: 14px;
                            font-weight: bold;

                            >span {
                                font-weight: normal;
                            }
                        }

                        >span {
                            padding-bottom: 5px;
                            display: block;
                            font-size: 14px;
                        }
                    }


                }
            }
        }
    }

    #page2 {
        .page_box {
            position: relative;

            >p {
                margin-left: 210px;
            }

            .blink5 {
                position: absolute;
                top: 180px;
                left: 135px;
                animation: blink-effect 1.5s step-end infinite;
                color: #879ec2;
                font-weight: bold;

            }

            .page_img {
                position: absolute;
                top: 0px;
                left: 150px;
                width: 100px;
                >img {
                    width: 100%;
                }
            }

            .page_inner {
                width: 100%;
                height: auto;

                .my_skill {
                    padding: 0 120px;
                    padding-bottom: 80px;
                    box-sizing: border-box;
                    margin: 0 auto;
                    margin-top: 70px;
                    cursor: pointer;
                    display: flex;
                    justify-content: space-evenly;


                    >li {
                        height: 100px;
                        width: 100px;
                        position: relative;
                        transform: scale(1.7);

                        >.inner {
                            position: absolute;
                            z-index: 6;
                            top: 50%;
                            left: 50%;
                            height: 80px;
                            width: 80px;
                            margin: -40px 0 0 -40px;
                            background: #fff;
                            border-radius: 100%;
                            box-shadow: 0 1px 0 rgba(0, 0, 0, 0.2);

                            >img {
                                width: 100%;
                            }
                        }

                        .numb,
                        .numb1,
                        .numb2,
                        .numb3 {
                            position: absolute;
                            bottom: -30px;
                            left: 50%;
                            transform: translate(-50%, -50%);
                            z-index: 10;
                            font-size: 13px;
                            font-weight: bold;
                        }

                        .circle {
                            .bar {
                                position: absolute;
                                height: 100%;
                                width: 100%;
                                background: #eee;
                                -webkit-border-radius: 100%;
                                clip: rect(0px, 100px, 100px, 50px);

                                .progress {
                                    position: absolute;
                                    height: 100%;
                                    width: 100%;
                                    -webkit-border-radius: 100%;
                                    clip: rect(0px, 50px, 100px, 0px);
                                    background: $color;
                                }
                            }

                            .left {
                                .progress {
                                    z-index: 1;
                                    transform: rotate(180deg);
                                }
                            }

                            .right,
                            .right1,
                            .right2,
                            .right3 {
                                z-index: 3;
                                transform: rotate(180deg);

                                .progress {
                                    animation-delay: 3s;
                                }
                            }

                            @keyframes right {
                                100% {
                                    transform: rotate(162deg);
                                }

                            }

                            @keyframes right1 {
                                100% {
                                    transform: rotate(162deg);
                                }

                            }

                            @keyframes right2 {
                                100% {
                                    transform: rotate(108deg);
                                }

                            }

                            @keyframes right3 {
                                100% {
                                    transform: rotate(72deg);
                                }

                            }
                        }
                    }

                }

                .skill_txt {
                    margin: 10px auto;
                    width: 1000px;
                    height: 120px;
                    border: 5px solid $color;
                    border-radius: 20px;
                    /*   background-color: $color; */

                    >p {
                        padding-top: 35px;
                        box-sizing: border-box;
                        text-align: center;
                        font-weight: bold;
                        line-height: 30px;
                    }

                    .skill_page {
                        display: none;

                        >h5 {
                            width: 40%;
                            text-align: center;
                            line-height: 120px;
                            font-size: 30px;
                            float: left;
                        }

                        >p {
                            margin-top: 25px;
                            float: left;
                            width: 60%;

                        }

                    }
                }

                .skill_2 {
                    width: 100%;
                    margin: 0px auto;
                    overflow: hidden;
                    display: flex;
                    padding: 0 280px; box-sizing: border-box;
                    >li {
                        width: 100px;
                        height: 100px;

                        &:nth-child(1) {
                            >img {
                                transform: translateY(40px);
                            }
                        }

                        &:nth-child(2) {
                            >img {
                                transform: translate(10px, 30px);
                            }
                        }


                        >img {
                            width: 100%;
                        }
                    }
                }

                .skill_3 {
                    width: 100%;
                    margin: 0 auto;
                    overflow: hidden;
                    margin-bottom: 50px;
                    display: flex;
                    padding: 0 330px; box-sizing: border-box;

                    >li {
                        width: 100px;
                        height: 100px;

                        >img {
                            width: 100%;
                        }
                    }
                }
            }


        }
    }

    #page3 {

        >img {
            position: absolute;
            z-index: -1;
            width: 100%;
            height: 100vh;
        }

        .page_box {
            position: relative;

